/*********************************************************************
*
*       _cbDialog_A
*
* Purpose:
*   Callback routine of dialog A
*/
static void _cbDialog_A(WM_MESSAGE * pMsg) {
  int Id, NCode;
  WM_HWIN hDlg, hItem;
  hDlg = pMsg->hWin;
  switch (pMsg->MsgId) {
  case WM_PAINT:
    /* Owner drawn background of dialog */
    GUI_SetBkColor(GUI_LIGHTGREEN);
    GUI_Clear();
    break;
  case WM_INIT_DIALOG:
    /* Init slider */
    hItem = WM_GetDialogItem(hDlg, GUI_ID_SLIDER0);
    SLIDER_SetRange(hItem, 0, 9999);
    SLIDER_SetValue(hItem, _Value);
    /* Init edit widget */
    hItem = WM_GetDialogItem(hDlg, GUI_ID_EDIT0);
    EDIT_SetDecMode(hItem, _Value, 0, 9999, 0, 0);
    EDIT_SetTextAlign(hItem, GUI_TA_HCENTER);
    break;
  case WM_NOTIFY_PARENT:
    NCode = pMsg->Data.v;               /* Notification code */
    switch (NCode) {
    case WM_NOTIFICATION_RELEASED:      /* React only if released */
      Id = WM_GetId(pMsg->hWinSrc);     /* Id of widget */
      if (Id == GUI_ID_BUTTON0) {
        GUI_EndDialog(hDlg, 1);
        _hDialog[_CurrentDialogIndex] = 0;
        _CurrentDialogIndex = -1;
      }
      break;
    case WM_NOTIFICATION_VALUE_CHANGED: /* Value has changed */
      Id = WM_GetId(pMsg->hWinSrc);     /* Id of widget */
      if (Id == GUI_ID_SLIDER0) {
        /* SLIDER-widget has changed, update EDIT-widget */
        hItem = WM_GetDialogItem(hDlg, GUI_ID_SLIDER0);
        _Value = SLIDER_GetValue(hItem);
        hItem = WM_GetDialogItem(hDlg, GUI_ID_EDIT0);
        EDIT_SetValue(hItem, _Value);
      } else if (Id == GUI_ID_EDIT0) {
        /* If EDIT-widget has changed, update SLIDER-widget */
        hItem = WM_GetDialogItem(hDlg, GUI_ID_EDIT0);
        _Value = EDIT_GetValue(hItem);
        hItem = WM_GetDialogItem(hDlg, GUI_ID_SLIDER0);
        SLIDER_SetValue(hItem, _Value);
      }
      break;
    }
    break;
  default:
    WM_DefaultProc(pMsg);
  }
}

/*********************************************************************
*
*       _cbDialog_B
*
* Purpose:
*   Callback routine of dialog B
*/
static void _cbDialog_B(WM_MESSAGE * pMsg) {
  int NCode;
  WM_HWIN hDlg;
  hDlg = pMsg->hWin;
  switch (pMsg->MsgId) {
  case WM_PAINT:
    /* Owner drawn background of dialog */
    GUI_SetBkColor(GUI_LIGHTGRAY);
    GUI_Clear();
    GUI_DrawBitmap(&bmLogoBitmap, (260 - bmLogoBitmap.XSize) / 2, 40);
    break;
  case WM_NOTIFY_PARENT:
    NCode = pMsg->Data.v;               /* Notification code */
    switch (NCode) {
    case WM_NOTIFICATION_RELEASED:      /* React only if released */
      GUI_EndDialog(hDlg, 1);
      _hDialog[_CurrentDialogIndex] = 0;
      _CurrentDialogIndex = -1;
      break;
    }
    break;
  default:
    WM_DefaultProc(pMsg);
  }
}

/*********************************************************************
*
*       _cbDialog_C
*
* Purpose:
*   Callback routine of dialog C
*/
static void _cbDialog_C(WM_MESSAGE * pMsg) {
  int NCode, Id, IdEdit, i;
  WM_HWIN hDlg, hItem, hEdit;
  hDlg = pMsg->hWin;
  /* Get focussed edit widget */
  hEdit = WM_GetFocussedWindow();
  IdEdit = WM_GetId(hEdit);
  if ((IdEdit < GUI_ID_EDIT0) || (IdEdit > GUI_ID_EDIT3)) {
    hEdit = 0;
  }
  switch (pMsg->MsgId) {
  case WM_PAINT:
    /* Owner drawn background of dialog */
    GUI_SetBkColor(GUI_LIGHTMAGENTA);
    GUI_Clear();
    /* Draw values of edit fields */
    GUI_SetColor(GUI_BLACK);
    for (i = 0; i < 4; i++) {
      I32 Value;
      hItem = WM_GetDialogItem(hDlg, GUI_ID_EDIT0 + i);
      Value = EDIT_GetValue(hItem);
      GUI_GotoXY(90, 55 + i * 20);
      GUI_DispDec(Value, 4);
    }
    break;
  case WM_INIT_DIALOG:
    /* Init edit widgets */
    hItem = WM_GetDialogItem(hDlg, GUI_ID_EDIT0);
    EDIT_SetDecMode(hItem, 1234, 0, 9999, 0, 0);
    hItem = WM_GetDialogItem(hDlg, GUI_ID_EDIT1);
    EDIT_SetDecMode(hItem, 4321, 0, 9999, 0, 0);
    hItem = WM_GetDialogItem(hDlg, GUI_ID_EDIT2);
    EDIT_SetDecMode(hItem,    0, 0, 9999, 0, 0);
    hItem = WM_GetDialogItem(hDlg, GUI_ID_EDIT3);
    EDIT_SetDecMode(hItem,    0, 0, 9999, 0, 0);
    /* Set buttons to not focussable state */
    for (i = BUTTON_ID_0; i <= BUTTON_ID_DOWN; i++) {
      WM_HWIN hButton = WM_GetDialogItem(hDlg, i);
      BUTTON_SetFocussable(hButton, 0);
    }
    break;
  case WM_NOTIFY_PARENT:
    Id = WM_GetId(pMsg->hWinSrc);
    NCode = pMsg->Data.v;               /* Notification code */
    switch (NCode) {
    case WM_NOTIFICATION_VALUE_CHANGED: /* Value has changed */
      Id = WM_GetId(pMsg->hWinSrc);     /* Id of widget */
      break;
    case WM_NOTIFICATION_RELEASED:      /* React only if released */
      switch (Id) {
      case BUTTON_ID_DOWN:
        if (IdEdit < GUI_ID_EDIT3) {
          hEdit = WM_GetDialogItem(hDlg, IdEdit + 1);
        }
        break;
      case BUTTON_ID_UP:
        if (IdEdit > GUI_ID_EDIT0) {
          hEdit = WM_GetDialogItem(hDlg, IdEdit - 1);
        }
        break;
      case BUTTON_ID_PREV:
        if (IdEdit) {
          EDIT_AddKey(hEdit, GUI_KEY_LEFT);
        }
        break;
      case BUTTON_ID_NEXT:
        if (IdEdit) {
          EDIT_AddKey(hEdit, GUI_KEY_RIGHT);
        }
        break;
      case BUTTON_ID_0:
      case BUTTON_ID_1:
      case BUTTON_ID_2:
      case BUTTON_ID_3:
      case BUTTON_ID_4:
      case BUTTON_ID_5:
      case BUTTON_ID_6:
      case BUTTON_ID_7:
      case BUTTON_ID_8:
      case BUTTON_ID_9:
        if (IdEdit) {
          /* Add key to edit widget */
          EDIT_AddKey(hEdit, '0' + Id - BUTTON_ID_0);
          /* Invalidate window to make sure value will be shown */
          WM_InvalidateWindow(hDlg);
        }
        break;
      case GUI_ID_BUTTON0:
        GUI_EndDialog(hDlg, 1);
        _hDialog[_CurrentDialogIndex] = 0;
        _CurrentDialogIndex = -1;
        break;
      }
      if (hEdit) {
        WM_SetFocus(hEdit);
      }
    }
    break;
  default:
    WM_DefaultProc(pMsg);
  }
}

