static void _cbDialog_E(WM_MESSAGE * pMsg) {
  int NCode;
  WM_HWIN hDlg;
  hDlg = pMsg->hWin;
  switch (pMsg->MsgId) {
  case WM_PAINT:
    /* Owner drawn background of dialog */
    GUI_SetBkColor(GUI_CYAN);
    GUI_Clear();
    break;
  case WM_NOTIFY_PARENT:
    NCode = pMsg->Data.v;               /* Notification code */
    switch (NCode) {
    case WM_NOTIFICATION_RELEASED:      /* React only if released */
      GUI_EndDialog(hDlg, 1);
      _hDialog[_CurrentDialogIndex] = 0;
      _CurrentDialogIndex = -1;
      break;
    }
    break;
  default:
    WM_DefaultProc(pMsg);
  }
}

/*********************************************************************
*
*       _ShowDialog
*
* Purpose:
*   Hides the previous dialog, creates or shows the new dialog
*/
static void _ShowDialog(int Number) {
  WM_CALLBACK * afpDialog[GUI_COUNTOF(_aDlgResource)] = { /* Array of callback function pointers */
    _cbDialog_A, _cbDialog_B, _cbDialog_C, _cbDialog_D, _cbDialog_E
  };
  if (_CurrentDialogIndex == Number) {
    return; /* Return if nothing to do */
  }
  if (_hDialog[_CurrentDialogIndex]) {
    WM_HideWindow(_hDialog[_CurrentDialogIndex]); /* Hide old dialog */
  }
  _CurrentDialogIndex = Number;
  if (_hDialog[_CurrentDialogIndex]) {
    WM_ShowWindow(_hDialog[_CurrentDialogIndex]); /* Show new dialog */
  } else {
    /* Create new dialog */
    _hDialog[Number] = GUI_CreateDialogBox(_aDlgResource[_CurrentDialogIndex].pResource, 
                                           _aDlgResource[_CurrentDialogIndex].nEntrys, 
                                           afpDialog[_CurrentDialogIndex], 
                                           _hParent, 0, 0);
  }
}

/*********************************************************************
*
*       _cbButton
*
* Purpose:
*   Callback routine for the transparent buttons A - E
*/
static void _cbButton(WM_MESSAGE *pMsg) {
  char acBuffer[10];
  GUI_RECT Rect;
  WM_HWIN hWin;
  hWin = pMsg->hWin;
  switch (pMsg->MsgId) {
  case WM_PAINT:
    /* Draw a transparent button */
    WM_GetClientRect(&Rect);
    GUI_SetColor(GUI_BLACK);
    GUI_DrawRectEx(&Rect);
    if (BUTTON_IsPressed(hWin)) {
      GUI_DrawRect(1, 1, Rect.x1 - 1, Rect.y1 - 1);
      GUI_SetFont(&GUI_Font24B_ASCII);
    } else {
      GUI_SetFont(&GUI_Font24_ASCII);
    }
    GUI_SetTextMode(GUI_TM_TRANS);
    BUTTON_GetText(hWin, acBuffer, sizeof(acBuffer));
    GUI_DispStringInRect(acBuffer, &Rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
    break;
  default:
    _pcbCallbackButton(pMsg); /* The original callback */
    break;
  }
}

/*********************************************************************
*
*       _cbMenu
*
* Purpose:
*   Callback routine for button menu
*/
static void _cbMenu(WM_MESSAGE * pMsg) {
  WM_HWIN hWin, ahButton[5];
  int i, Id;
  hWin = pMsg->hWin;
  switch (pMsg->MsgId) {
  case WM_CREATE:
    /* Create the buttons A - E */
    for (i = 0; i < GUI_COUNTOF(ahButton); i++) {
      char acButtonText[] = {" "};
      acButtonText[0] = 'A' + i;
      /* Create the buttons with transparency flag */
      ahButton[0] = BUTTON_CreateEx(10, 10 + i * 40, 35, 35, 
                                    hWin, WM_CF_SHOW | WM_CF_HASTRANS, 0, GUI_ID_BUTTON0 + i);
      BUTTON_SetFont(ahButton[0], &GUI_Font24B_ASCII);
      BUTTON_SetText(ahButton[0], acButtonText);
      /* Save the original button callback routine for default operations 
         and set the new callback routine for buttons A - E */
      if (!i) {
        _pcbCallbackButton = WM_SetCallback(ahButton[0], _cbButton);
      } else {
        WM_SetCallback(ahButton[0], _cbButton);
      }
    }
    break;
  case WM_PAINT:
    GUI_DrawBitmap(&bmBackGround, 0, 0); /* Draw the background */
    break;
  case WM_NOTIFY_PARENT:
    if (pMsg->Data.v == WM_NOTIFICATION_RELEASED) {
      Id = WM_GetId(pMsg->hWinSrc);      /* Id of widget */
      _ShowDialog(Id - GUI_ID_BUTTON0);  /* Show the dialog */
    }
    break;
  default:
    WM_DefaultProc(pMsg);
  }
}

/*********************************************************************
*
*       _cbParent
*
* Purpose:
*   Callback routine for dialog parent window
*/
static void _cbParent(WM_MESSAGE * pMsg) {
  GUI_RECT Rect;
  WM_GetClientRect(&Rect);
  switch (pMsg->MsgId) {
  case WM_PAINT:
    /* Draw the background, visible if none of the dialogs A - E exist */
    GUI_SetBkColor(GUI_LIGHTBLUE);
    GUI_Clear();
    GUI_SetColor(GUI_BLACK);
    GUI_SetFont(&GUI_Font24B_ASCII);
    WM_GetClientRect(&Rect);
    GUI_DispStringInRect("Press any button\non the right side", &Rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
    break;
  default:
    WM_DefaultProc(pMsg);
  }
}

/*********************************************************************
*
*       _cbIntro
*
* Purpose:
*   Callback routine of intro dialog.
*/
static void _cbIntro(WM_MESSAGE * pMsg) {
  WM_HWIN hDlg;
  GUI_RECT Rect;
  int Id, i, ySizeText, yPos = 20;
  hDlg = pMsg->hWin;
  switch (pMsg->MsgId) {
  case WM_PAINT:
    WM_GetClientRect(&Rect);
    GUI_SetFont(&GUI_Font13B_ASCII);
    GUI_SetBkColor(GUI_WHITE);
    GUI_SetColor(GUI_BLACK);
    GUI_Clear();
    GUI_DrawBitmap(&bmLogoBitmap, (Rect.x1 - bmLogoBitmap.XSize) / 2, yPos);
    ySizeText = GUI_GetFontSizeY();
    yPos += bmLogoBitmap.YSize + 30;
    for (i = 0; i < GUI_COUNTOF(_apIntro); i++) {
      GUI_DispStringHCenterAt(_apIntro[i], Rect.x1 / 2, yPos);
      yPos += ySizeText;
    }
    break;
  case WM_KEY:
    switch (((WM_KEY_INFO*)(pMsg->Data.p))->Key) {
    case GUI_KEY_ESCAPE:
    case GUI_KEY_ENTER:
      GUI_EndDialog(hDlg, 0);
      break;
    }
    break;
  case WM_NOTIFY_PARENT:
    if (pMsg->Data.v == WM_NOTIFICATION_RELEASED) {
      Id = WM_GetId(pMsg->hWinSrc);      /* Id of widget */
      if (Id == GUI_ID_BUTTON0) {
        GUI_EndDialog(hDlg, 1);
      }
    }
    break;
  default:
    WM_DefaultProc(pMsg);
  }
}

/*********************************************************************
*
*       MainTask
*
**********************************************************************
*/
void MainTask(void);
void MainTask(void) {
  WM_HWIN hMainFrame, hClientWindow;
  GUI_RECT Rect;
  GUI_Init();
  GUI_CURSOR_Show();
  /* Enable use of memory devices (if available) */
  #if GUI_SUPPORT_MEMDEV
    WM_SetCreateFlags(WM_CF_MEMDEV);
    WM_EnableMemdev(WM_HBKWIN);
  #endif
  /* Enable redrawing mechanism for background window */
  WM_SetDesktopColor(GUI_BLACK);
  /* Create and execute the intro dialog */
  GUI_ExecDialogBox(_aIntro, GUI_COUNTOF(_aIntro), _cbIntro, WM_HBKWIN, 0, 0);
  /* Create main frame window */
  hMainFrame = FRAMEWIN_CreateEx(0, 0, 320, 240, 
                                 WM_HBKWIN, WM_CF_SHOW, 0, 0, "Application", 0);
  FRAMEWIN_SetTextAlign(hMainFrame, GUI_TA_HCENTER);
  hClientWindow = WM_GetClientWindow(hMainFrame); /* Get client window of main frame window */
  WM_GetClientRectEx(hClientWindow, &Rect);       /* Get size of window */
  /* Create parent window for dialogs A - E */
  _hParent = WM_CreateWindowAsChild(0, 0, 259, Rect.y1, 
                                    hClientWindow, WM_CF_SHOW, _cbParent, 0);
  /* Create button menu window */
  WM_CreateWindowAsChild(260, 0, Rect.x1 - 260, Rect.y1, hClientWindow, WM_CF_SHOW, _cbMenu, 0);
  while(1) {
    WM_Exec();
    GUI_X_WAIT_EVENT();
  }
}

